import React from 'react';

import {useSelector,useDispatch} from 'react-redux';
import {removeRoundAction,addRoundAction} from '../../../store/totalCountReducer'
import InputSetting from '../../../UI/InputSetting/InputSetting';

const DefaultRoundSetting = (props) => {
  const dispatch= useDispatch()
  const count=useSelector((state)=>state.roundCount)
  
  const addRoundCount=()=>{
    dispatch(addRoundAction(1))
  }
  const removeRoundCount=()=>{
    dispatch(removeRoundAction(1))
  }

  return (
    <div></div>
    // <InputSetting 
    // add={addRoundCount} 
    // remove={removeRoundCount} 
    // value={count.roundCount} 
    // tittle={props.tittle}
    // count={true}/>
  )
};

export default DefaultRoundSetting;
